import './App.css';
import data from './Data';
import PokedexGenerator from './components/PokedexGenerator';

function App() {
  return (
    <div className="App">
      <h1>Pokedex</h1>
      <header className="App-header">
        <PokedexGenerator dataPokemons={ data } />
      </header>
    </div>
  );
}

export default App;
